/* global define */
// var requirejs = require("./../node_modules/requirejs/require");
var requirejs = require("requirejs");
var define = requirejs.define;

// var define = requirejs.define;

(function() {
    "use strict";
    var originalDefine = define;
    var define = function() {

        var template = "Teste";
        var result = originalDefine.apply(originalDefine, arguments);
        if ( typeof result === "object" ) {
            result.template = template;
        }

        return result;
    };
})();

define([], function() {

    return {};
});

